import { useStore } from "react-redux";
import s from './Users.module.css'

const Users = (props) => {
	return (
		<div>
			{
				props.state.map(u => <div key='u.id'>
					<div>
						<div></div>
						<div></div>
					</div>
					<div></div>
				</div>)
			}
		</div>
	)
}

export default Users;
